function imageClick(s){s.preventDefault();let e=this.parentElement.parentElement;e.classList.contains("col-3")?(this.src=this.src.replace(/t\/thumb\//,""),e.classList.add("col-12"),e.classList.remove("col-3")):(e.classList.add("col-3"),e.classList.remove("col-12"))}Array.from(document.getElementsByClassName("post-image")).forEach(function(s){s.onclick=imageClick});